import React,{useRef,useState} from "react";
import '../styles/tour-details.css';
import { Container,Row,Col,Form, ListGroup } from "reactstrap";
import { useParams } from "react-router-dom";
import tourData from '../assets/data/tours';
import calculateAvgRating from "../utils/avgRating";
import avatar from '../assets/images/avatar.jpg';

const TourDetails=()=>{
    const {id}=useParams()
    const reviewmsgRef=useRef('');
    const [tourRating,setTourRating]=useState(null);
// this is an static data later we will call our API and load our data fro database
    const tour=tourData.find(tour=>tour.id === id);
// destructure properties from tour object
    const {photo, title, desc, price,address, reviews, city, distance, maxGroupSize}= tour;
    const {totalRating,avgRating}=calculateAvgRating(reviews);
    const options = { day: "numeric", month: "long", year: "numeric" };
    return <>
    <section>
        <Container>
            <Row>
                <Col lg="8">
                <div className="tour_content"> <img src={photo} alt="" />
                <div className="tour_info"> <h2>{title}</h2>
                <div className="d-flex align-items-center gap-5">
                <span className="tour__rating d-flex align-items-center gap-1">
                <i class="ri-star-fill" style={{'color':"var(--secondary-color)"}}></i>{calculateAvgRating===0?null:avgRating}
                {totalRating==0?'Not rated':<span>({reviews?.length})</span>}

                </span>
                <span>
                <i class="ri-map-pin-user-fill"></i>{address}
                </span>
                </div>
                <div className="tour__extra-details">
                    <span>
                    <i class="ri-map-pin-2-line"></i>{city}
                    <i class="ri-money-dollar-circle-fill"></i>$ {price} /per person
                    <i class="ri-map-pin-time-line"></i> {distance} KM
                    <i class="ri-group-line"></i>{maxGroupSize} People
                    </span>
                </div>
                <h5>Description</h5>
                <p>{desc}</p>
                </div>
                <div className="tour_reviews mt-4">
                    <h4>Reviews ({reviews?.length} reviews)</h4>
                    <Form>
                        <div className="d-flex align-items-center gap-3 mb-4 rating_group">
                            <span onClick={setTourRating=>(1)}>1<i class="ri-star-s-fill"></i></span>
                            <span onClick={setTourRating=>(2)}>2<i class="ri-star-s-fill"></i></span>
                            <span onClick={setTourRating=>(3)}>3<i class="ri-star-s-fill"></i></span>
                            <span onClick={setTourRating=>(1)}>4<i class="ri-star-s-fill"></i></span>
                            <span onClick={setTourRating=>(1)}>5<i class="ri-star-s-fill"></i></span>
                        </div>
                        <div className="review__input">
                            <input type="text" ref={reviewmsgRef} placeholder="Share your thoughts"/>
                            <button className="button btn primary__btn text-white" type="submit">Submit</button>
                        </div>
                    </Form>
                    {/*   */}
</div>
                </div>

                </Col>
            </Row>
        </Container>
    </section>
    </>;
};
export default TourDetails;
